using System;
using System.Linq;
using Shouldly;
using System.Threading.Tasks;
using Volo.Abp.Domain.Repositories;
using Xunit;

namespace Resume.ResumeMains
{
    public class ResumeMainsAppServiceTests : ResumeApplicationTestBase
    {
        private readonly IResumeMainsAppService _resumeMainsAppService;
        private readonly IRepository<ResumeMain, Guid> _resumeMainRepository;

        public ResumeMainsAppServiceTests()
        {
            _resumeMainsAppService = GetRequiredService<IResumeMainsAppService>();
            _resumeMainRepository = GetRequiredService<IRepository<ResumeMain, Guid>>();
        }

        [Fact]
        public async Task GetListAsync()
        {
            // Act
            var result = await _resumeMainsAppService.GetListAsync(new GetResumeMainsInput());

            // Assert
            result.TotalCount.ShouldBe(2);
            result.Items.Count.ShouldBe(2);
            result.Items.Any(x => x.Id == Guid.Parse("d7b8bf86-874c-4961-8695-bbcc9f6e813c")).ShouldBe(true);
            result.Items.Any(x => x.Id == Guid.Parse("1d4db84d-1769-455c-8079-243495471378")).ShouldBe(true);
        }

        [Fact]
        public async Task GetAsync()
        {
            // Act
            var result = await _resumeMainsAppService.GetAsync(Guid.Parse("d7b8bf86-874c-4961-8695-bbcc9f6e813c"));

            // Assert
            result.ShouldNotBeNull();
            result.Id.ShouldBe(Guid.Parse("d7b8bf86-874c-4961-8695-bbcc9f6e813c"));
        }

        [Fact]
        public async Task CreateAsync()
        {
            // Arrange
            var input = new ResumeMainCreateDto
            {
                UserMainId = Guid.Parse("1daad4d9-d337-4208-ab19-c69077877115"),
                ResumeName = "1932b1e52cc046fd937bcb7b2dee6edbd51d0d89d14a4f9883",
                MarriageCode = "9afa0a7eacc6463eb76c19cab1df437d981a9b0a86334c3080",
                MilitaryCode = "3a7206a6e02b4ee0a663be5bf5348d44d9e7e81f078b4d3ab2",
                DisabilityCategoryCode = "7f5b1e18f5804ed9aa00d968c1fba5d2dd4eb633ece842029b",
                SpecialIdentityCode = "7d3551bd14644bc9aa451c180a58031386018c09d5eb4247ba",
                Main = true,
                Autobiography1 = "",
                Autobiography2 = "",
                ExtendedInformation = "",
                DateA = new DateTime(2015, 4, 10),
                DateD = new DateTime(2006, 4, 9),
                Sort = 2091856396,
                Note = "",
                Status = "cc042df89f29417bae489408c7663b9f3bc2ee774243485d83"
            };

            // Act
            var serviceResult = await _resumeMainsAppService.CreateAsync(input);

            // Assert
            var result = await _resumeMainRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.UserMainId.ShouldBe(Guid.Parse("1daad4d9-d337-4208-ab19-c69077877115"));
            result.ResumeName.ShouldBe("1932b1e52cc046fd937bcb7b2dee6edbd51d0d89d14a4f9883");
            result.MarriageCode.ShouldBe("9afa0a7eacc6463eb76c19cab1df437d981a9b0a86334c3080");
            result.MilitaryCode.ShouldBe("3a7206a6e02b4ee0a663be5bf5348d44d9e7e81f078b4d3ab2");
            result.DisabilityCategoryCode.ShouldBe("7f5b1e18f5804ed9aa00d968c1fba5d2dd4eb633ece842029b");
            result.SpecialIdentityCode.ShouldBe("7d3551bd14644bc9aa451c180a58031386018c09d5eb4247ba");
            result.Main.ShouldBe(true);
            result.Autobiography1.ShouldBe("");
            result.Autobiography2.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2015, 4, 10));
            result.DateD.ShouldBe(new DateTime(2006, 4, 9));
            result.Sort.ShouldBe(2091856396);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("cc042df89f29417bae489408c7663b9f3bc2ee774243485d83");
        }

        [Fact]
        public async Task UpdateAsync()
        {
            // Arrange
            var input = new ResumeMainUpdateDto()
            {
                UserMainId = Guid.Parse("67007b21-daf4-44a9-9005-6fb75dc39f1c"),
                ResumeName = "17210966210f42d187d1d76af4510db5dd39d498adde42e8a2",
                MarriageCode = "cde9ec8105f94250abe7902f3d867dbf94b9356b16844dd5af",
                MilitaryCode = "2c0d2b816ee84dfe895a3fb996603fb19fca5bb522bf4be983",
                DisabilityCategoryCode = "a9c6cc72909a4cb79eb95a9109b010d11676a401ee6c41a187",
                SpecialIdentityCode = "b67c40c0ac234a04901955511905d0b27aa8c946802a4613a5",
                Main = true,
                Autobiography1 = "",
                Autobiography2 = "",
                ExtendedInformation = "",
                DateA = new DateTime(2014, 3, 16),
                DateD = new DateTime(2000, 2, 4),
                Sort = 365421232,
                Note = "",
                Status = "bf8f9ec959e240fbbda7480fe9cf99dfdc061541436642a391"
            };

            // Act
            var serviceResult = await _resumeMainsAppService.UpdateAsync(Guid.Parse("d7b8bf86-874c-4961-8695-bbcc9f6e813c"), input);

            // Assert
            var result = await _resumeMainRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.UserMainId.ShouldBe(Guid.Parse("67007b21-daf4-44a9-9005-6fb75dc39f1c"));
            result.ResumeName.ShouldBe("17210966210f42d187d1d76af4510db5dd39d498adde42e8a2");
            result.MarriageCode.ShouldBe("cde9ec8105f94250abe7902f3d867dbf94b9356b16844dd5af");
            result.MilitaryCode.ShouldBe("2c0d2b816ee84dfe895a3fb996603fb19fca5bb522bf4be983");
            result.DisabilityCategoryCode.ShouldBe("a9c6cc72909a4cb79eb95a9109b010d11676a401ee6c41a187");
            result.SpecialIdentityCode.ShouldBe("b67c40c0ac234a04901955511905d0b27aa8c946802a4613a5");
            result.Main.ShouldBe(true);
            result.Autobiography1.ShouldBe("");
            result.Autobiography2.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2014, 3, 16));
            result.DateD.ShouldBe(new DateTime(2000, 2, 4));
            result.Sort.ShouldBe(365421232);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("bf8f9ec959e240fbbda7480fe9cf99dfdc061541436642a391");
        }

        [Fact]
        public async Task DeleteAsync()
        {
            // Act
            await _resumeMainsAppService.DeleteAsync(Guid.Parse("d7b8bf86-874c-4961-8695-bbcc9f6e813c"));

            // Assert
            var result = await _resumeMainRepository.FindAsync(c => c.Id == Guid.Parse("d7b8bf86-874c-4961-8695-bbcc9f6e813c"));

            result.ShouldBeNull();
        }
    }
}